import React from "react";
import { YMaps,Placemark } from 'react-yandex-maps';

const Map = () => {
  return (
    <YMaps query={{apikey: 'c8b9e28d-92e5-436f-a252-fe89b025381f'}}>
            <Map defaultState={{ center: [55.75, 37.57], zoom: 9 }}>
                <Placemark geometry={[55.75, 37.57]} />
            </Map>
    </YMaps>
  );
}

export default Map;
